import React from "react";
import styled from "@emotion/styled";

export const NotDivContainer = styled.div`
  width: 100%;
  display: flex;
`;

export const NotDiv = styled.div`
  padding-top: 20rem;
  margin: auto;
  font-size: 10rem;
`;

export const TextColor = styled.div``;

export const NotFound: React.FC = () => {
  return (
    <NotDivContainer>
      <NotDiv>404</NotDiv>
    </NotDivContainer>
  );
};
